import '../../estilos/estilos.css'
import Menu from '../menu';
import { useState } from 'react'

function Cabecalho(){
    let [Show , setShow] = useState(false)
        if(!Show){
            Show = true
        }
        else(
            Show = false
        )
    return(
            <div className='cabPai' >
                <Menu 
                item1={Show}
                item2='Sobre'
                item3='Voltar para a home' />
            </div>
    )
}

export default Cabecalho;
